                                    stateKey: '', // Ví dụ: 'heroTitle' nếu dùng state
                                },
                                events: {
                                    onClick: { type: 'navigate', url: '/home' }, // Navigate khi click section
                                },
                            },
                            size: { width: 420, height: 574 },
                            styles: { color: '#ffffff', textAlign: 'center' },
