                                {
                                    id: 'hero-heading',
                                    type: 'heading',
                                    componentData: {
                                        content: 'Welcome to Our Site',
                                        dataSource: {
                                            type: 'api',
                                            url: 'https://api.example.com/hero',
                                            key: 'title',
                                        },
                                        events: {
                                            onHover: { type: 'showPopup', popupId: 'popup-1' }, // Show popup khi hover
                                        },
                                    },
                                    size: { width: 300, height: 50 },
                                    position: { desktop: { x: 60, y: 50 }, tablet: { x: 60, y: 50 }, mobile: { x: 30, y: 30 } },
                                    styles: { fontSize: '2rem', color: '#1f2937' },
                                },
                                {
                                    id: 'hero-button',
                                    type: 'button',
                                    componentData: {
                                        content: 'Get Started',
                                        dataSource: { type: 'static' },
                                        events: {
                                            onClick: { type: 'navigate', url: '/signup' }, // Navigate khi click button
