                                    },
                                    size: { width: 150, height: 40 },
                                    position: { desktop: { x: 135, y: 120 }, tablet: { x: 135, y: 120 }, mobile: { x: 80, y: 80 } },
                                    styles: { background: '#2563eb', color: '#fff', borderRadius: '8px' },
                                },
                            ],
                        },
                    },
                ],
            },
        ],
    },
    elements: {
        name: 'Elements',
        subCategories: [
            {
                id: 'basic-elements',
                name: 'Basic Elements',
                templates: [
                    {
                        id: 'heading-1',
                        name: 'Heading',
                        icon: 'fa-heading',
                        description: 'A customizable heading',
                        json: {
                            type: 'heading',
                            componentData: {
                                content: 'New Heading',
                                dataSource: {
                                    type: 'state',
                                    stateKey: 'headingContent', // Bind với state trong CreateLanding
                                },
                                events: {
                                    onClick: { type: 'showPopup', popupId: 'popup-1' }, // Show popup khi click
                                },
                            },
                            size: { width: 200, height: 50 },
                            styles: { fontSize: '1.5rem', color: '#1f2937' },
                        },
                    },
                    {
                        id: 'paragraph-1',
                        name: 'Paragraph',
                        icon: 'fa-paragraph',
                        description: 'A customizable paragraph',
                        json: {
                            type: 'paragraph',
                            componentData: {
                                content: 'This is a paragraph',
                                dataSource: {
                                    type: 'api',
                                    url: 'https://api.example.com/content',
                                    key: 'description',
                                },
                                events: {
                                    onHover: { type: 'navigate', url: '/about' }, // Navigate khi hover
                                },
                            },
                            size: { width: 200, height: 50 },
                            styles: { fontSize: '1rem', color: '#1f2937' },
                        },
                    },
                    {
                        id: 'button-1',
                        name: 'Button',
                        icon: 'fa-square',
                        description: 'A customizable button',
                        json: {
                            type: 'button',
                            componentData: {
                                content: 'Click Me',
                                dataSource: { type: 'static' },
                                events: {
                                    onClick: { type: 'submitForm', apiUrl: '/api/submit' }, // Submit form khi click
                                },
                            },
                            size: { width: 120, height: 40 },
                            styles: { background: '#2563eb', color: '#fff', borderRadius: '8px' },
                        },
                    },
                    {
                        id: 'form-1',
                        name: 'Form',
                        icon: 'fa-form',
                        description: 'A customizable form',
                        json: {
                            type: 'form',
                            componentData: {
                                title: 'Contact Us',
                                fields: [
                                    { type: 'text', placeholder: 'Name', label: 'Name' },
                                    { type: 'email', placeholder: 'Email', label: 'Email' },
                                ],
                                buttonText: 'Submit',
                                dataSource: {
                                    type: 'state',
                                    stateKey: 'formData', // Bind form input với state
                                },
                                events: {
                                    onSubmit: { type: 'submitForm', apiUrl: '/api/contact' }, // Submit form tới API
                                },
                            },
                            size: { width: 300, height: 200 },
                            styles: { background: '#ffffff', padding: '20px', borderRadius: '8px' },
                        },
                    },
                ],
            },
        ],
    },
    popups: {
        name: 'Popups',
        subCategories: [
            {
                id: 'basic-popups',
                name: 'Basic Popups',
                templates: [
                    {
                        id: 'popup-1',
                        name: 'Basic Popup',
                        icon: 'fa-window-restore',
                        description: 'A simple popup',
                        json: {
                            type: 'popup',
                            componentData: {
                                title: 'Popup Title',
                                content: 'Popup Content',
                                dataSource: {
                                    type: 'api',
                                    url: 'https://api.example.com/popup',
                                    key: 'message',
                                },
                                events: {
                                    onClick: { type: 'navigate', url: '/close' }, // Navigate khi click popup
                                },
                            },
                            size: { width: 300, height: 200 },
                            styles: { backgroundColor: '#ffffff', display: 'none' }, // Mặc định ẩn
                        },
                    },
                ],
            },
        ],
    },
    templates: {
        name: 'Templates',
        subCategories: [],
    },
};
